import Link from "next/link";

const Sidebar = props => {
  return (
    <div className="sidebar" style={{ height: "100vh", overflow: "auto" }}>
      <ul>
        {props.pokemon.map((pokemon, index) => (
          <li key={index + 1} className="m-2">
            <Link href="/p/[id]" as={`/p/${index + 1}`}>
              <a>{pokemon.name}</a>
            </Link>
          </li>
        ))}
      </ul>
    </div>
  );
};

export default Sidebar;
